  \"2014-12-09T23:54:54.289489\",\n\t\"name\": \"digital-map-of-water-level-changes-in-the-high-plains-aquifer-in-parts-of-colorado-kansas-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The High Plains aquifer extends from south
  of 32 degrees to almost 44 degrees north latitude and from 96 degrees 30 minutes
  to 104 degrees west longitude. The aquifer underlies about 175,000 square miles
  in parts of Colorado, Kansas, Nebraska, New Mexico, Oklahoma, South Dakota, Texas,
  and Wyoming. This dataset consists of a raster of water-level changes for the High
  Plains aquifer, predevelopment (about 1950) to 2013. This digital dataset was created
  using water-level measurements from 3,349 wells measured in both the predevelopment
  period (about 1950) and in 2013 and using other published information on water-level
  change in areas with few water-level measurements. The map was reviewed for consistency
  with the relevant data at a scale of 1:1,000,000.\",\n\t\"license_title\": null,\n\t\"extras\":
